import { useSate } from "react";
const Timetable = (props) => {
  const [i, iset] = useState(0);

  const arr = [
    "Monday",
    "Tuesday",
    "Wednesday",
    "Thursday",
    "Friday",
    "Satueday",
    "Sunday",
  ];
  return (
    <tr>
      <td>{arr[i]}</td>
      {props.day.map((e) => (
        <td colSpan={e.span} key={e.id}>
          <a href={e.link} target="_blank" rel="noreferrer">
            {e.sub}
          </a>
        </td>
      ))}
    </tr>
  );
};

export default Timetable;
